def read_images(directory):
    # 初始化图片对象列表
    image_names = []
    image_paths = []
    image_objects = []

    for filename in os.listdir(directory):
        filepath = os.path.join(directory, filename)
        if os.path.isfile(filepath) and filename.lower().endswith(('.png', '.jpg', '.jpeg', '.gif','.bmp', 'webp')):
            image_paths.append(filepath)
            image_names.append(filename)

    with concurrent.futures.ThreadPoolExecutor() as executor:
        image_objects = list(executor.map(preprocess, image_paths))
    
    result = [item for item in image_objects if item is not None]

    return image_paths, result


def preprocess(image_path):
    # 打开图片
    img = Image.open(image_path)
    
    # 获取原始图片尺寸
    width, height = img.size
    
    # 将图片横边缩放到原来的十分之一
    new_width = int(width / 20)
    # 根据比例计算新的高度
    new_height = int(height * (new_width / width))
    
    # 缩放图片
    resized_img = img.resize((new_width, new_height))

    if is_pure_color(resized_img):
        pass
    
    # 将 PIL 图片对象转换为 NumPy 数组
    np_img = np.array(resized_img)
    
    # 将彩色图像转换为灰度图像
    gray = cv2.cvtColor(np_img, cv2.COLOR_BGR2GRAY)
    
    # 返回处理后的灰度图像
    return gray
    # return np_img

def preprocess_images_in_parallel(directory):
    image_paths, _ = read_images(directory)
    # 使用多线程处理预处理图像
    with concurrent.futures.ThreadPoolExecutor() as executor:
        results = list(executor.map(preprocess, [os.path.join(directory, filename) for filename in image_paths]))
    return image_paths, results



def is_pure_color(img, color_threshold=0.95):
    
    # Convert image to grayscale
    img_gray = img.convert('L')
    
    # Get image dimensions
    width, height = img_gray.size
    
    # Count total pixels
    total_pixels = width * height
    
    # Convert image to list of pixel values
    pixel_values = list(img_gray.getdata())
    
    # Count black and white pixels
    black_pixels = sum(1 for pixel in pixel_values if pixel < 128)
    white_pixels = total_pixels - black_pixels
    
    # Calculate percentage of black and white pixels
    black_percentage = black_pixels / total_pixels
    white_percentage = white_pixels / total_pixels
    
    # Check if either black or white percentage is above threshold
    if black_percentage >= color_threshold or white_percentage >= color_threshold:
        return True
    else:
        return False





def postprocess(images, feature_index, cluster_mapping):
    # 建立图片和簇的对应关系
    image_cluster_mapping = {}

    # 统计每个图片中被分配到不同簇的特征点数目
    for image_index, img_path in enumerate(images):
        # 初始化图片对应的簇的计数器
        cluster_counter = {}
        # 获取该图片的特征索引
        img_features = [key for key in feature_index if key[0] == image_index]
        # 遍历该图片的特征索引
        for feature_key in img_features:
            # 查找该特征点所属的簇
            for cluster, indices in cluster_mapping.items():
                if feature_key in indices:
                    # 统计特征点所属簇的计数
                    cluster_counter[cluster] = cluster_counter.get(cluster, 0) + 1
                    break
        # 选择该图片中特征点数量最多的簇
        if cluster_counter:
            # # print(img_path, cluster_counter)
            # max_cluster = max(cluster_counter.keys(), key=lambda x: cluster_counter[x])
            # image_cluster_mapping[img_path] = max_cluster

            # 初始化一个列表来存储所有的 max_key
            max_keys_list = []

            max_value = max(cluster_counter.values())  # 找到最大值

            # max_keys = [key for key, value in cluster_counter.items() if value == max_value]

            # 找到所有最大值对应的键
            for key, value in cluster_counter.items():
                if value == max_value:
                    max_keys_list.append(key)

            # 将所有最大值对应的键都写入到 image_cluster_mapping 中
            image_cluster_mapping[img_path] = max_keys_list

    # print(image_cluster_mapping)

    return image_cluster_mapping


def cluster_images(image_cluster_mapping):
    # 提取每个图片对应的 cluster_counter
    image_paths = list(image_cluster_mapping.keys())
    cluster_counters = list(image_cluster_mapping.values())
    
    # 将 cluster_counter 转换为稀疏矩阵的形式
    feature_vectors = []
    indices = []
    indptr = [0]
    for counter in cluster_counters:
        if not isinstance(counter, dict):  # 检查是否为字典
            continue
        for cluster, count in counter.items():
            indices.append(cluster)
            feature_vectors.append(count)
        indptr.append(len(indices))
    feature_vectors = np.array(feature_vectors)
    indices = np.array(indices)
    indptr = np.array(indptr)
    feature_matrix = csr_matrix((feature_vectors, indices, indptr), shape=(len(cluster_counters), max(indices) + 1))
    
    # 使用 DBSCAN 聚类
    dbscan = DBSCAN(eps=0.5, min_samples=2)  # 根据情况调整 eps 和 min_samples
    labels = dbscan.fit_predict(feature_matrix)
    
    # 构建聚类结果
    clustered_images = defaultdict(list)
    for label, image_path in zip(labels, image_paths):
        clustered_images[label].append(image_path)

    print(clustered_images)
    
    return clustered_images


