def group_similar_values(dictionary, similarity_threshold=0):
    result_dict = {}
    
    # 遍历原始字典的键值对
    for key, value in dictionary.items():
        # 将值转换为元组进行比较
        value_tuple = tuple(value)
        found = False
        
        # 检查已有的结果字典中是否有相似的值
        for existing_value in result_dict:
            if len(existing_value) != len(value_tuple):
                continue
            
            # 检查每个元素是否相似
            similarity_count = sum(1 for a, b in zip(existing_value, value_tuple) if a == b)
            if similarity_count >= max(len(existing_value), len(value_tuple)) * similarity_threshold:
                result_dict[existing_value].append(key)
                found = True
                break
        
        # 如果未找到相似的值，则创建一个新的键
        if not found:
            result_dict[value_tuple] = [key]
    
    return result_dict


def process_data(data):
    # Step 1: Sort data based on the number of elements in the values (in descending order)
    sorted_data = sorted(data.items(), key=lambda x: len(x[1]), reverse=True)
    
    # Step 2: Initialize result and index dictionaries
    result = {}
    index = {}
    order = 1
    
    # Step 3: Iterate through sorted data and perform the required checks
    for key, value in sorted_data:
        # Step 3.1: Check if the key is already in result
        if key in result:
            continue
        
        # Step 3.2: Check if data[key] is a subset of any value in index
        found = False
        for i_key, i_value in index.items():
            if set(value).issubset(set(i_value)):
                result[i_key] = result.get(i_key, []) + [key]
                found = True
                break
        
        if found:
            continue
        
        # Step 3.3: Check if data[key] has intersection with any value in index
        for i_key, i_value in index.items():
            intersection = set(value).intersection(set(i_value))
            if len(intersection) >= 2:
                result[i_key] = result.get(i_key, []) + [key]
                found = True
                break
        
        if found:
            continue
        
        # Step 3.4: Add to result and index
        result[order] = [key]
        index[order] = value
        order += 1
        print(order)
    
    return result










