def postprocess_speed(images, feature_index, cluster_mapping):
    # 建立图片和簇的对应关系
    image_cluster_mapping = {}

    # 调整 cluster_mapping 为以特征索引为键，簇为值的字典
    indexed_cluster_mapping = {}
    for cluster, indices in cluster_mapping.items():
        for index in indices:
            indexed_cluster_mapping[index] = cluster

    # 定义并发处理函数
    def process_image(image_index, img_path):
        nonlocal image_cluster_mapping
        # 初始化图片对应的簇的计数器
        cluster_counter = {}
        # 获取该图片的特征索引
        img_features = [key for key in feature_index if key[0] == image_index]
        # 遍历该图片的特征索引
        for feature_key in img_features:
            cluster = indexed_cluster_mapping.get(feature_key)
            if cluster:
                cluster_counter[cluster] = cluster_counter.get(cluster, 0) + 1
        # 选择该图片中特征点数量最多的簇
        if cluster_counter:
            max_value = max(cluster_counter.values())
            max_keys = [key for key, value in cluster_counter.items() if value == max_value]
            image_cluster_mapping[img_path] = max_keys

    # 创建线程列表
    threads = []
    for image_index, img_path in enumerate(images):
        thread = threading.Thread(target=process_image, args=(image_index, img_path))
        thread.start()
        threads.append(thread)

    # 等待所有线程结束
    for thread in threads:
        thread.join()

    return image_cluster_mapping

def process_data_speed(data):
    # Step 1: Sort data based on the number of elements in the values (in descending order)
    sorted_data = sorted(data.items(), key=lambda x: len(x[1]), reverse=True)
    
    # Step 2: Initialize result and index dictionaries
    result = {}
    index = {}
    order = 1
    
    lock = threading.Lock()  # 创建锁对象
    
    # 定义并发处理函数
    def process_item(key, value):
        nonlocal result, index, order
        found = False
        for i_key, i_value in index.items():
            with lock:  # 加锁
                if set(value).issubset(set(i_value)):
                    result[i_key] = result.get(i_key, []) + [key]
                    found = True
                    break
            if found:
                return
        for i_key, i_value in index.items():
            with lock:  # 加锁
                intersection = set(value).intersection(set(i_value))
                if len(intersection) >= 2:
                    result[i_key] = result.get(i_key, []) + [key]
                    found = True
                    break
            if found:
                return
        with lock:  # 加锁
            result[order] = [key]
            index[order] = value
            order += 1

    # 创建线程列表
    threads = []
    for key, value in sorted_data:
        thread = threading.Thread(target=process_item, args=(key, value))
        thread.start()
        threads.append(thread)

    # 等待所有线程结束
    for thread in threads:
        thread.join()

    return result


def create_links(result):
    # Check if 'result' directory exists, if not, create it
    if not os.path.exists('result'):
        os.makedirs('result')
    
    # Iterate through result dictionary
    for key, files in result.items():
        # Create directory for the key
        key_dir = os.path.join('result', str(key))
        if not os.path.exists(key_dir):
            os.makedirs(key_dir)
        
        # Create symbolic links for files in the key directory
        for file in files:
            src_path = os.path.abspath(file)
            dst_path = os.path.join(key_dir, os.path.basename(file))
            # Create symbolic link
            os.symlink(src_path, dst_path)
            # print(f"Created symbolic link: {dst_path} -> {src_path}")


